import SmallDisplayBox from "./SmallDisplayBox";

const description = {
    resi: ['Design and develop high-quality software in a highly collaborative environment. ', 
    'Program in the backend environment of Resi streaming service',
    'Learn Software development practices such as continuous integration, test automation, and code review',
    'Develop solutions to bugs as well as new features to increase user experience and business productivity'], 
    academicInitiative: [
        'Develop emails using HTML/CSS that get delivered to over 4,500 staff/faculty and 70,000+ student population',
        'Create mobile responsive UI/UX in emails and websites with CSS that allow cross-platform accessibility ',
        'Translate designs and wireframes into high-quality code using HTML, CSS, JavaScript',
        'Analyze enterprise data and create visual dashboards in Tableau to make informed decisions'
    ],
    CTE: '', 
}

const tools = {
    resi: ['Java', 'Dockers', 'Jenkins', 'Git', 'MySQL', 'TypeScript', 'React'],
    academicInitiative: [],
}

function ExperienceContainer(){
    return(
        <div className="experience-container">

            <SmallDisplayBox title="Resi Media, LLC" 
            jobTitle="Software Engineer Intern" 
            description={description.resi}/>

            <SmallDisplayBox title="Texas A&M Office for Academic Innovation" 
            jobTitle="Support Specialist (Front-End Development and Data Analytics" 
            description={description.academicInitiative}/>
            </div>
    );
}

export default ExperienceContainer;
